import React from "react";
import './projects.css';
import { faLaptop } from "@fortawesome/free-solid-svg-icons";

export default function Projects() {
    function handleClick(url) {
        window.open(url, '_blank', 'noopener,noreferrer'); 
      }
    return (
        <section id="projects">
        <div className="projects-heading">
          <span className="projects-heading-text">Projects</span>
          <span className="projects-subheading">Stuff I've made</span>
        </div>
        <div id="abtbox">
            <div id="abtbox_item" onClick={()=>handleClick("https://maps.app.goo.gl/X82Q1qajhWBcoLix9")}>
              <span className="boxtitle">St. Peter’s Basilica</span>
              <span className="boximg"><img src={laptop} alt="basilica image" /></span>
              <span className="boxtxt"><p>St. Peter’s Basilica is one of the world’s largest churches and a masterpiece of Renaissance architecture. Known for its impressive dome, designed in part by Michelangelo, the basilica is a sacred site for Catholics and an architectural marvel. Inside, you’ll find stunning artwork, including Michelangelo’s Pietà and Bernini's grand altar.</p></span>
            </div>
            <div id="abtbox_item" onClick={()=>handleClick("https://maps.app.goo.gl/tC7Rumx51x7PPFuD7")}>
              <span className="boxtitle">Apostolic Palace</span>
              <span className="boximg"><img src={laptop} alt="basilica image" /></span>
              <span className="boxtxt"><p>The Apostolic Palace is the official residence of the Pope and the administrative hub of the Vatican. This impressive building houses the Vatican Museums, the papal apartments, and the famous Sistine Chapel. It's filled with priceless artworks, including Raphael's frescoes and Michelangelo’s iconic Sistine Chapel ceiling.</p></span>
            </div>
            <div id="abtbox_item" onClick={()=>handleClick("https://maps.app.goo.gl/bgjCyMs5AdTvebQH8")}>
              <span className="boxtitle">Castel Gandolfo Papal Palace</span>
              <span className="boximg"><img src={laptop} alt="basilica image" /></span>
              <span className="boxtxt"><p>Located in the scenic town of Castel Gandolfo, this papal summer residence offers stunning views of Lake Albano. Visitors can explore the beautiful gardens and palace rooms, which are open to the public. The estate provides a serene escape and a glimpse into the private quarters of past popes.</p></span>
            </div>
        </div>
        </section>
    )
}
